import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(){
    super();

    this.state = {
      monsters : []
    }
  }

  render () {
    return (
      <div className="App">
        <header className="App-header">
          <h1>hello</h1>
        </header>
      </div>
    );
  }
}

export default App;
